import React from 'react';
import './App.css';

function App() {
  const goToVisualizer = () => {
    window.location.href = '/Visualizer.html';  // Redirects to Visualizer.html
  };

  return (
    <div className="App">
      <div className="welcome-screen">
        <h1>Welcome</h1>
        <button onClick={goToVisualizer}>Go to Visualizer</button>
      </div>
    </div>
  );
}

export default App;
